import React, { useState } from 'react';

const Analysis = () => {
  const [activeModel, setActiveModel] = useState('t5');

  const models = [
    { id: 't5', name: 'T5', summary: 'T5 model summary placeholder...' },
    { id: 'bart', name: 'BART', summary: 'BART model summary placeholder...' },
    { id: 'pegasus', name: 'Pegasus', summary: 'Pegasus model summary placeholder...' }
  ];

  const clauses = [
    { type: 'Confidentiality', confidence: 0.95, description: 'Confidentiality clause detected' },
    { type: 'Termination', confidence: 0.87, description: 'Termination conditions identified' },
    { type: 'Liability', confidence: 0.92, description: 'Liability limitations found' }
  ];

  const riskAssessment = {
    level: 'Medium',
    score: 65,
    recommendations: ['Review termination clauses', 'Consider liability limits']
  };

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-6">Analysis Results</h2>

      {/* Document Summary */}
      <div className="card mb-6">
        <h3 className="text-lg font-medium mb-4">Document Summary</h3>
        <div className="mb-4">
          <div className="flex space-x-1 mb-4">
            {models.map((model) => (
              <button
                key={model.id}
                onClick={() => setActiveModel(model.id)}
                className={`px-4 py-2 rounded-md text-sm font-medium ${
                  activeModel === model.id
                    ? 'bg-primary-600 text-white'
                    : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                }`}
              >
                {model.name}
              </button>
            ))}
          </div>
          <div className="bg-gray-50 p-4 rounded-md">
            <p className="text-gray-700">
              {models.find(m => m.id === activeModel)?.summary}
            </p>
          </div>
        </div>
        <div className="flex items-center space-x-4 text-sm text-gray-600">
          <span>Quality Score: 85%</span>
          <span>Processing Time: 2.3s</span>
          <button className="text-primary-600 hover:text-primary-800">Copy to Clipboard</button>
        </div>
      </div>

      {/* Clause Classification */}
      <div className="card mb-6">
        <h3 className="text-lg font-medium mb-4">Clause Classification</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          {clauses.map((clause, index) => (
            <div key={index} className="border rounded-lg p-4">
              <div className="flex justify-between items-start mb-2">
                <h4 className="font-medium">{clause.type}</h4>
                <span className={`px-2 py-1 rounded text-xs ${
                  clause.confidence > 0.9 ? 'bg-green-100 text-green-800' :
                  clause.confidence > 0.8 ? 'bg-yellow-100 text-yellow-800' :
                  'bg-red-100 text-red-800'
                }`}>
                  {(clause.confidence * 100).toFixed(0)}%
                </span>
              </div>
              <p className="text-sm text-gray-600">{clause.description}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Risk Assessment */}
      <div className="card">
        <h3 className="text-lg font-medium mb-4">Risk Assessment</h3>
        <div className="flex items-center mb-4">
          <span className={`px-3 py-1 rounded-full text-sm font-medium ${
            riskAssessment.level === 'High' ? 'bg-red-100 text-red-800' :
            riskAssessment.level === 'Medium' ? 'bg-yellow-100 text-yellow-800' :
            'bg-green-100 text-green-800'
          }`}>
            {riskAssessment.level} Risk
          </span>
          <span className="ml-4 text-gray-600">Score: {riskAssessment.score}/100</span>
        </div>
        <div className="bg-gray-50 p-4 rounded-md">
          <h4 className="font-medium mb-2">Recommendations</h4>
          <ul className="list-disc list-inside text-sm text-gray-700">
            {riskAssessment.recommendations.map((rec, index) => (
              <li key={index}>{rec}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Analysis;
